import { useState, useEffect } from 'react';
import './App.css';
import Login from './components/signin/signin';
import TopMovies from './components/top-movies/top-movies';
import Navbar from './components/navbar/navbar';
import SingleMovie from './components/single-movie/single-movie';
import SingleStar from './components/single-star/single-star';
import { Routes, Route } from 'react-router-dom';

function App() {
	const [mySession, setSession] = useState({});

	useEffect(() => {
        console.log( "App.js", typeof mySession, mySession);
    }, [mySession]);

	return (
		<div className="App">
			{/* <Navbar/> */}
			<div className="content">
				<Routes>
					<Route exact path="/login" element={<Login mySession={mySession} setSession={setSession}/>}/>
					<Route path="/" element={mySession.status ? <></> : <Login mySession={mySession} setSession={setSession}/>}/>
					<Route exact path="/top-movies" element={mySession.status ? <TopMovies/> : <Login mySession={mySession} setSession={setSession}/>}/>
					<Route exact path="/single-movie" element={mySession.status ? <SingleMovie/> : <Login mySession={mySession} setSession={setSession}/>}/>
					<Route exact path="/single-star" element={mySession.status ? <SingleStar/> : <Login mySession={mySession} setSession={setSession}/>}/>
				</Routes>
			</div>
		</div>
	);
}

export default App;
